import React, { ReactNode } from 'react';
import Head from 'next/head';
import { Container } from '../styles/PaymentWizard';

type Props = {
  children?: ReactNode;
  title?: string;
};

const WizardLayout: React.FC<Props> = ({ children, title }) => {
  return (
    <React.Fragment>
      <Head>
        <title>{title}</title>
        <meta charSet="utf-8" />
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Head>
      <div className="container payment-container">
        <div className="row">
          <div className="col-sm-2">Logo</div>
          <div className="col-sm-8">{children}</div>
          <div className="col-sm-2">Cancel</div>
        </div>
      </div>
    </React.Fragment>
  );
};

export { WizardLayout };
